                                                            <p></p><p>PKO BP to największy bank w Polsce zarówno pod kątem posiadanych aktywów (444 mld zł), jak i liczby klientów (11,8 mln). Dlatego też tak ważne jest, aby wszyscy, którzy mają w nim konto, zapoznali się z najnowszym komunikatem. W nim bank ostrzega przed oszustami.</p>

<h3><strong>PKO BP z ważnym komunikatem</strong></h3>

<p>W najnowszym komunikacie, opublikowanym na stronie PKO BP, możemy przeczytać ostrzeżenie skierowane do wszystkich klientów. <strong>Bank przestrzega przed aktywnie działającymi oszustami, którzy próbują wyłudzić dane użytkowników. </strong>W tym celu stosują oni fałszywe strony internetowe, które znajdują się między innymi pod adresami&nbsp;Lpkobiznes[.]info oraz Ipbkbiznes[.]com.</p>

