</div>
</div></div></ins><div id="oa-360-1728615255918_ddsyw7hkg" class="placeholderPlug" style="color: transparent !important; padding: 0px 10px !important; border-radius: 10px !important; border: 2px solid !important; font-family: sans-serif !important; font-weight: 400 !important; letter-spacing: 3px !important; font-size: 40px !important; line-height: 60px !important; position: absolute !important;">ad</div></div></div><p>W związku z tym PKO BP przypomina o kilku podstawowych zasadach, którymi wszyscy klienci powinni się kierować. <strong>Te proste reguły wystarczą, aby zminimalizować ryzyko wpadnięcia w pułapkę oszustów.</strong></p>

<p>Przede wszystkim PKO BP przypomina, że oficjalnie wiadomości e-mail oraz SMS od banku nigdy nie zawierają żadnych linków. Po drugie, bank przypomina, aby dokładnie sprawdzać adres strony internetowej, na której próbujemy się zalogować. Po trzecie, bank apeluje, aby nie wchodzić na jego stronę z poziomu reklam internetowych, także zamieszczonych w wyszukiwarkach.</p>

<p><strong>Zobacz:&nbsp;</strong><a href="https://www.telepolis.pl/fintech/bezpieczenstwo/mbank-ostrzega-oszustwo-phishing-pracownik">mBank ma pilny komunikat. Lepiej dodaj ten numer do kontaktów</a><br>
<strong>Zobacz:&nbsp;</strong><a href="https://www.telepolis.pl/fintech/taryfy-promocje-uslugi/velobank-program-lojalnosciowy-velokorzysci">Masz konto w VeloBank? Będą darmówki do odebrania</a></p><p></p>
