.user-remove-fav { position: absolute; right: 2rem; top: 1rem; width: 20px; height: 20px; border-radius: 50%; font-size: 7px; -webkit-box-pack: center; justify-content: center; z-index: 100; }

.user-remove-fav i { margin-left: -1px; }

.user-remove-fav:hover { color: rgb(189, 23, 31); background: rgb(255, 255, 255); }

@media (max-width: 767.98px) {
  .user-aktywnosc .border-right { border-right: none !important; }
  .user-form a img { width: 35px; height: 35px; }
}

.ankiety-wynik label { width: 30%; min-width: 200px; margin: 0px; }

.ankiety-wynik span { font-weight: 700; }

.ankiety-archiwum a { background: rgb(255, 255, 255); padding: 0.8rem 1rem; display: flex; -webkit-box-pack: justify; justify-content: space-between; margin-bottom: 0.5rem; box-shadow: rgb(255, 255, 255) 0px 0px 10px 4px; transition: 0.3s; font-weight: 700; }

.ankiety-archiwum a.archive { color: rgb(155, 155, 155); font-weight: 400; }

.ankiety-archiwum a .meta { color: rgb(155, 155, 155); }

.ankiety-archiwum a:hover { box-shadow: rgb(233, 233, 233) 0px 4px 10px 4px; font-weight: 700; }

@media (max-width: 575.98px) {
  .ankiety-wynik label { width: 80%; min-width: 200px; }
}

.error-404 { background: rgb(0, 0, 0); color: rgb(255, 255, 255); min-height: 80vh; }

.error-404-big { font-weight: 700; font-size: 24px; line-height: 30px; }

.error-404-watermark { position: relative; }

.error-404-watermark::after { content: "404"; color: rgb(255, 255, 255); opacity: 0.1; position: absolute; top: 0px; left: 50%; transform: translateX(-50%); font-size: 200px; }

@media (max-width: 991.98px) {
  .error-404 { text-align: center; }
  .error-404-watermark::after { font-size: 30vw; top: 50%; transform: translate(-50%, -50%); }
}

.modal { overflow-y: auto; }

.modal-backdrop { background: rgb(255, 255, 255); }

.modal-backdrop.show { opacity: 0.7; }

.modal-dialog { max-width: 600px; }

.modal-content { border-radius: 0px; border-right: none; border-bottom: none; border-left: none; border-image: initial; border-top: 4px solid rgb(189, 23, 31); }

.modal .close { position: absolute; right: 2rem; top: 10px; }

.modal-header { border: none; -webkit-box-pack: center; justify-content: center; padding: 2rem 0px 0px; }

.modal-body { padding: 1rem 2rem; }

.modal-body .custom-checkbox { font-size: 10px; line-height: 12px; color: rgba(0, 0, 0, 0.5); margin-bottom: 1rem; }

.modal-body .custom-checkbox label a { color: rgb(74, 144, 226); }

.modal-body .custom-checkbox label a:hover { text-decoration: underline; }

.modal-body .custom-checkbox label::before { background: rgb(255, 255, 255); border: 1px solid rgba(0, 0, 0, 0.3); top: 0px; }

.modal-body .custom-checkbox label::after { top: 0px; }

.modal-body .custom-checkbox .custom-control-input:checked ~ .custom-control-label::before { border: none; }

.modal-body .custom-checkbox.bigger { font-size: 16px; line-height: 16px; }

.modal-footer { border: none; -webkit-box-pack: center; justify-content: center; }

.porownanie-telefonow-modal { position: fixed; right: 0px; top: 60%; transform: rotate(90deg) translateX(50%); transform-origin: right top; font-size: 14px; z-index: 50; }

.porownanie-telefonow { position: relative; }

.porownanie-telefonow .katalog-telefonow-item { max-width: 160px; font-weight: 700; }

.porownanie-telefonow .katalog-telefonow-item span { display: block; padding: 5px 0px; }

.porownanie-telefonow table td, .porownanie-telefonow table th { padding-left: 0px !important; padding-right: 0px !important; }

.porownanie-telefonow table th { font-weight: 400; }

.porownanie-telefonow table td { font-weight: 700; }

.porownanie-telefonow table .difference td, .porownanie-telefonow table .difference th { background: rgba(189, 23, 31, 0.1); }

.porownanie-telefonow-scroll { width: 100%; overflow-x: auto; }

.porownanie-telefonow-scroll .section-title { width: 100%; position: absolute; left: 0px; }

.porownanie-telefonow-scroll .pt-wrapper { display: flex; }

.porownanie-telefonow-scroll .pt-wrapper.data { font-weight: 700; }

.porownanie-telefonow-scroll .pt-wrapper.data .pt-col { padding: 30px 0px 15px; }

.porownanie-telefonow-scroll .pt-wrapper.differences { background: rgba(189, 23, 31, 0.1); }

.porownanie-telefonow-scroll .pt-wrapper ul { padding: 0px 15px; margin: 0px 10px; font-weight: 400; }

.porownanie-telefonow-scroll .pt-title-wrapper { height: 60px; margin: 20px 0px 10px; }

.porownanie-telefonow-scroll .pt-col { min-width: 180px; }

.porownanie-telefonow-scroll .pt-col, .porownanie-telefonow-scroll .pt-col-pojedynek { -webkit-box-flex: 1; flex-grow: 1; }

.porownanie-telefonow-scroll .specs-name { position: absolute; left: 0px; opacity: 0.6; }

.telefony-filtry { position: relative; }

.telefony-filtry .form-group { margin-bottom: 10px; }

.telefony-filtry label { font-size: 12px; line-height: 14px; margin-bottom: 0.2rem; }

.telefony-filtry .custom-select { height: 30px; padding: 0px; border-top: none; border-right: none; border-left: none; border-image: initial; border-bottom: 1px solid rgba(74, 74, 74, 0.2); border-radius: 0px; }

.telefony-filtry .custom-select:focus { outline: none; box-shadow: none; border-bottom: 1px solid rgb(189, 23, 31); }

.telefony-filtry [data-toggle="collapse"][aria-expanded="false"] { border-bottom: 1px solid rgb(0, 0, 0); }

@media (max-width: 991.98px) {
  .telefony-filtry-triggers { transform: translateZ(0px); }
  .telefony-filtry-triggers.sticky { position: fixed; z-index: 10000; left: 0px; width: 100%; background: rgb(255, 255, 255); padding: 1rem; box-shadow: rgb(0, 0, 0) 0px 0px 10px -5px; height: 60px; }
  .telefony-filtry-triggers.fixed { position: absolute; right: 0px; top: auto; bottom: 0px; left: auto !important; }
}

@media (max-width: 991.98px) {
  .telefony-filtry { display: none; }
  .telefony-filtry.show { height: 100vh; display: block; position: fixed; inset: 0px; background: rgb(255, 255, 255); z-index: 2000; overflow-y: scroll; padding: 0px 1rem; }
}

