div.relatedbottom > a:hover > svg { stroke: rgb(255, 255, 255); fill: rgb(255, 255, 255); }

div.relatedContainer { display: flex; flex-direction: column; position: absolute; width: 100%; height: 100%; background: rgb(40, 40, 40); }

div.relatedContent { flex: 1 1 auto; display: flex; height: 100%; max-height: 100%; width: 100%; flex-flow: wrap; place-content: stretch space-around; overflow: hidden; }

@media (max-width: 1200px) {
  span.relatedtitle { font-size: 14px; }
}

@media (max-width: 1400px) {
  div.relatedbutton { flex: 1 1 33.3333%; height: calc(33.3333% - 10px); max-width: calc(33.3333% - 10px); }
  span.relatedtitle { font-size: 13px; }
  div.relatedbottom > a { padding: 0px; }
}

@media (max-width: 800px) {
  div.relatedbutton { flex: 1 1 50%; height: calc(50% - 10px); max-width: calc(50% - 10px); }
  span.relatedtitle { font-size: 14px; }
  div.relatedbottom > a { padding: 0px; }
}

@media (max-width: 600px) {
  div.relatedbutton { height: calc(50% - 10px); }
  span.relatedtitle { font-size: 14px; }
  div.relatedbottom { flex: 0 0 15vh; height: 15vh; max-height: 15vh; }
  div.relatedbottom > a { padding: 2px; }
}

@media (max-width: 45px) {
  div.relatedContent { padding: 0px 5vw; box-sizing: border-box; }
  div.relatedbutton { height: calc(60% - 10px); margin: 20vh 5px; }
}

div.relatedContainer.relatedThreeLines { flex-direction: column-reverse; }

div.relatedContainer.relatedThreeLines > div.relatedContent { height: 33.3333%; flex-grow: 0; margin-bottom: 3vh; }

div.relatedContainer.relatedThreeLines div.relatedbutton { flex: 1 1 31%; height: 100%; max-width: 31%; width: auto; }

@keyframes loader { 
  0% { transform: rotate(0deg); }
  100% { transform: rotate(360deg); }
}

#play-click-img-wait { animation: 2s linear 0s infinite normal none running loader; }

.play-click-wait circle { stroke: none; stroke-width: 0px; opacity: 0.3; }

#lc0 { opacity: 0.6; }

#lc1 { opacity: 0.7; }

#lc2 { opacity: 0.8; }

#lc3 { opacity: 0.9; }

#lc4 { opacity: 1; }

#lc5 { opacity: 0.9; }

#lc6 { opacity: 0.8; }

#lc7 { opacity: 0.7; }

#lc8 { opacity: 0.6; }

@keyframes animateTitinc { 
  0% { left: var(--onnanimatetitincstartpos); }
  100% { left: var(--onnanimatetitinclengthleft); }
}

#MovieTitle .titlewrapper #titin #titinc.animateTitinc { transition: 0.1s; animation: auto linear 0s infinite alternate both running animateTitinc; }

.buttonOpacity { opacity: 0 !important; }

.progressBarButton { pointer-events: all; }
