@charset "utf-8";

@import url("//fonts.googleapis.com/css?family=Roboto:400,500");

body { margin: 0px; padding: 0px; border: none; }

.fbc-alert { position: absolute; color: red; font-size: 13px; }

.fbc { background: rgb(249, 249, 249); border: 1px solid rgb(193, 193, 193); border-radius: 3px; height: 421px; width: 300px; }

.fbc-header { height: 50px; margin: 10px; }

.fbc-logo { float: right; user-select: none; }

.fbc-logo-img { background: url("https://www.gstatic.com/recaptcha/api2/logo_48.png") 0% 0% / 30px no-repeat; height: 30px; margin: 0px 12px; width: 30px; }

.fbc-logo-text { color: rgb(155, 155, 155); font-family: Roboto, helvetica, arial, sans-serif; font-size: 9px; font-weight: 400; line-height: 9px; margin-top: 2px; text-align: center; width: 54px; }

.fbc-message { font-family: Roboto, helvetica, arial, sans-serif; font-size: 12px; font-weight: 400; height: 20px; width: 250px; margin-left: 25px; }

.fbc-main-message { position: absolute; top: 85px; font-size: 14px; }

.fbc-input-field { height: 50px; }

.fbc-input-field input:focus { border: 1px solid rgb(74, 144, 226); }

.fbc-input-field input { border: 1px solid rgb(193, 193, 193); height: 35px; font-family: Roboto, helvetica, arial, sans-serif; font-size: 16px; font-weight: 500; margin: 5px 24px; padding-left: 5px; padding-right: 5px; outline: none; width: 240px; }

.fbc-payload { margin-top: 10px; margin-bottom: 10px; height: 150px; background: white; padding-top: 70px; }

.fbc-audio-payload { margin-top: 30px; height: 70px; }

.fbc-payload audio { margin: 8px 25px 0px; width: 250px; }

.fbc-audio-space { height: 135px; }

.fbc-button-verify { float: right; margin: 2px 11px 2px 24px; }

.fbc-button-verify input { background: rgb(74, 144, 226); border: 0px; border-radius: 2px; color: rgb(255, 255, 255); cursor: pointer; font-family: Roboto, helvetica, arial, sans-serif; font-size: 12px; font-weight: 500; height: 25px; margin-top: 2px; min-width: 74px; padding: 0px 10px; text-align: center; width: 90px; }

.fbc-buttons { margin: 3px 20px 20px 11px; }

.fbc-button-holder { display: inline-block; height: 24px; margin-right: 10px; width: 24px; }

.fbc-button-reload { background: url("https://www.gstatic.com/recaptcha/api2/refresh_black.png"); }

.fbc-button-audio { background: url("https://www.gstatic.com/recaptcha/api2/audio_black.png"); }

.fbc-button-image { background: url("https://www.gstatic.com/recaptcha/api2/image_black.png"); }

.fbc-button:hover, .fbc-button:focus { opacity: 0.8; }

.fbc-audio-controls { width: 250px; margin-left: 25px; }

.fbc-button { background-repeat: no-repeat; border: none; color: transparent; font-size: 0px; height: 24px; width: 24px; opacity: 0.55; }

.fbc-challenge { position: relative; top: 6px; }

.fbc-success { height: 350px; position: relative; }

.fbc-verification-token { height: 180px; margin: 45px 25px 10px; width: 250px; }

.fbc-verification-token textarea { background: rgb(235, 235, 235); border: 1px solid rgb(74, 144, 226); color: rgb(74, 144, 226); font-size: 10px; height: 100%; padding: 0px; resize: none; width: 100%; }

.fbc-message.fbc-valid-time { margin-top: 20px; }

.fbc-message.fbc-paste { margin-top: 180px; }

