@charset "windows-1252";

.videoAdUiActionCta { position: absolute; bottom: 30px; box-sizing: border-box; padding: 5px; max-width: 75%; }

.uac-android-on-3p-instream.videoAdUiActionCta, .uac-ios-on-3p-instream.videoAdUiActionCta { background: linear-gradient(to top, rgba(0, 0, 0, 0), rgba(0, 0, 0, 0.4) 100%); bottom: unset; max-width: 100%; padding: 12px; top: 0px; width: 100%; }

.newProgressBarVariant .videoAdUiActionCta { bottom: 46px; }

.videoAdUiActionCtaInset { font-family: arial, sans-serif; font-weight: 500; font-size: 16px; background: white; display: flex; flex-direction: row; border-radius: 8px; box-shadow: rgba(60, 64, 67, 0.5) 0px 1px 3px; overflow: hidden; height: 50px; pointer-events: auto; }

.uac-android-on-3p-instream .videoAdUiActionCtaInset, .uac-ios-on-3p-instream .videoAdUiActionCtaInset { background: transparent; box-shadow: none; }

.videoAdUiActionCtaIconContainer { display: none; min-width: 50px; z-index: 1000; }

.uac-android-on-3p-instream .videoAdUiActionCtaIconContainer, .uac-ios-on-3p-instream .videoAdUiActionCtaIconContainer { margin-right: 12px; }

.videoAdUiActionCtaTextAndLink { display: flex; flex-direction: column; justify-content: space-between; padding: 5px; -webkit-box-flex: 1; flex-grow: 1; overflow: hidden; max-width: 250px; }

.uac-android-on-3p-instream .videoAdUiActionCtaTextAndLink, .uac-ios-on-3p-instream .videoAdUiActionCtaTextAndLink { max-width: none; padding: 3px; }

.videoAdUiActionCtaText { white-space: nowrap; overflow: hidden; text-overflow: ellipsis; cursor: pointer; }

.uac-android-on-3p-instream .videoAdUiActionCtaText, .uac-ios-on-3p-instream .videoAdUiActionCtaText { color: rgb(255, 255, 255); }

.videoAdUiActionCtaLink { color: rgb(133, 139, 140); font-size: 12px; font-weight: 400; white-space: nowrap; overflow: hidden; text-overflow: ellipsis; cursor: pointer; }

.uac-android-on-3p-instream .videoAdUiActionCtaLink { background-image: url("https://googleads.g.doubleclick.net/pagead/images/gmob/google_play_icon_white.svg"); background-repeat: no-repeat; background-size: auto 100%; color: transparent; }

.uac-ios-on-3p-instream .videoAdUiActionCtaLink { background-image: url("https://googleads.g.doubleclick.net/pagead/images/gmob/app_store_icon_white.svg"); background-repeat: no-repeat; background-size: auto 100%; color: transparent; }

.videoAdUiActionCtaRightSide { display: flex; justify-content: center; flex-direction: column; min-width: -webkit-max-content; }

.videoAdUiActionCtaButton { height: 35px; line-height: 35px; text-transform: uppercase; margin: 5px; padding: 0px 8px; font-weight: 500; font-size: 14px; }

.uac-android-on-3p-instream .videoAdUiActionCtaButton, .uac-ios-on-3p-instream .videoAdUiActionCtaButton { margin: 0px; padding: 0px 20px; }

.videoAdUiActionIcon { height: 50px; cursor: pointer; }

.actionCtaCollapsibleContainer { display: flex; width: 100%; }

.uac-android-on-3p-instream .actionCtaCollapsibleContainer, .uac-ios-on-3p-instream .actionCtaCollapsibleContainer { justify-content: space-between; }

.videoAdUiFloatingLayer .videoAdUiActionCtaButton { border-radius: 0px; }

.videoAdUiFloatingLayer .uac-android-on-3p-instream .videoAdUiActionCtaButton { border-radius: 4px; background-color: rgb(1, 135, 95); }

.videoAdUiFloatingLayer .uac-ios-on-3p-instream .videoAdUiActionCtaButton { border-radius: 100px; background-color: rgb(0, 122, 255); }

.videoAdUiFloatingLayer .videoAdUiActionCtaInset { border-radius: 0px; }

.videoAdUiFloatingLayer .videoAdUiActionCtaTextAndLink { overflow: hidden; }

.videoAdUiFloatingLayer .actionCtaCollapsibleContainer.actionCtaContainerCollapsed { max-width: 0px; transition: max-width 1s ease-out; }

.videoAdUiFloatingLayer .actionCtaCollapsibleContainer:not(.actionCtaContainerCollapsed), .videoAdUiFloatingLayer .videoAdUiActionCta:hover .actionCtaCollapsibleContainer { transition: max-width 1s ease-out; }

.videoAdUiFloatingLayer .videoAdUiActionCtaExpandIcon, .videoAdUiFloatingLayer .videoAdUiActionCta:hover .videoAdUiActionCtaExpandIcon { display: block; cursor: pointer; background-color: rgb(70, 136, 241); position: absolute; height: 18px; width: 18px; border-radius: 50%; top: 43px; left: 43px; box-shadow: rgba(0, 0, 0, 0.12) 0px 0px 2px 0px, rgba(0, 0, 0, 0.24) 0px 2px 2px 0px; opacity: 0; border: none; padding: 0px; font-size: 100%; outline: 0px; transition: none; }

.videoAdUiFloatingLayer .videoAdUiActionCtaExpandIcon.actionCtaExpandIconShown { opacity: 1; transition: opacity 0.15s cubic-bezier(0, 0, 0.2, 1) 0.7s; }

@media (max-width: 480px) {
  .videoAdUiActionCta { bottom: 18px; }
  .uac-android-on-3p-instream.videoAdUiActionCta, .uac-ios-on-3p-instream.videoAdUiActionCta { padding: 8px; }
  .videoAdUiActionCtaInset { height: 35px; font-size: 10px; }
  .uac-android-on-3p-instream .videoAdUiActionCtaInset, .uac-ios-on-3p-instream .videoAdUiActionCtaInset { font-size: 14px; }
  .videoAdUiActionCtaButton { height: 25px; line-height: 25px; font-size: 11px; padding: 0px 4px; }
  .videoAdUiActionCtaLink { font-size: 9px; }
  .uac-android-on-3p-instream .videoAdUiActionCtaTextAndLink, .uac-ios-on-3p-instream .videoAdUiActionCtaTextAndLink { padding: 1px; }
  .videoAdUiActionIcon { height: 35px; }
  .videoAdUiActionCtaIconContainer { min-width: 35px; }
}

@media (max-aspect-ratio: 1 / 1) {
  .videoAdUiVariantCtaOverlay .videoAdUiBottomBar { bottom: 65px; }
  .videoAdUiVariantCtaOverlay .rewardedAdUiBottomBar { bottom: 65px; }
  .videoAdUiVariantCtaOverlay .videoAdUiPreSkipContainer { bottom: 72px; }
  .videoAdUiVariantCtaOverlay div.videoAdUiSkipContainer { bottom: 72px; }
  .videoAdUiVariantCtaOverlay .videoAdUiSkipContainer { bottom: 72px; }
  .videoAdUiActionCtaTextAndLink { max-width: none; }
  .videoAdUiActionCta { bottom: 0px; width: 100%; max-width: 100%; }
  .newProgressBarVariant .videoAdUiActionCta { bottom: 0px; }
  .videoAdUiActionCtaInset { width: 100%; }
}

.videoAdUiButton { border-radius: 3px; box-shadow: rgba(0, 0, 0, 0.4) 0px 1px 1px 0px; cursor: pointer; pointer-events: auto; }

.videoAdUiButtonPrimary { background-color: rgb(66, 133, 244); color: white; }

.videoAdUiButtonPrimaryInverse { color: rgb(66, 133, 244); }

.closeButtonContainer { float: right; height: 24px; width: 24px; padding: 12px; pointer-events: auto; position: relative; }

.closeButtonBackground { width: 24px; height: 24px; background-color: rgb(60, 64, 67); border-radius: 50%; z-index: 1; position: absolute; box-shadow: rgba(0, 0, 0, 0.12) 0px 2px 4px; }

.closeCountdownText { font-size: 16px; color: white; width: 24px; height: 24px; position: absolute; font-family: Roboto, Helvetica, Arial, sans-serif; z-index: 5; text-align: center; line-height: 24px; }

.closeButtonIcon { color: white; width: 24px; height: 24px; position: absolute; z-index: 5; text-align: center; }

.closeButtonIcon > svg { width: 20px; height: 20px; transform: translateY(2px); }

.unifyRefresh .closeButtonContainer { position: absolute; right: 0px; top: 0px; z-index: 2000; float: none; }

.videoAdUiIconFallback .closeButtonContainer, .overlayContainer .closeButtonContainer { position: absolute; right: 0px; top: 0px; float: none; cursor: pointer; height: 20px; width: 20px; padding: 6px; }

.overlayContainer .closeButtonBackground, .overlayContainer .closeButtonIcon { height: 20px; width: 20px; }

.overlayContainer .closeButtonIcon > svg { height: 16px; width: 16px; }

.ctaAdvertiserInfo { text-align: center; pointer-events: auto; }

.videoAdUiCtaLayer .ctaAdvertiserInfo { display: none; }

.videoAdUiTopBar .ctaAdvertiserInfo { padding-top: 40px; }

.advertiserChannelThumbnailContainer { margin-bottom: 10px; }

.advertiserChannelThumbnail { display: none; height: 50px; width: 50px; border-radius: 50%; border: 2px solid white; cursor: pointer; }

.advertiserDescription { font-family: arial, sans-serif; text-align: center; text-transform: lowercase; font-size: 10px; color: white; margin-bottom: 5px; cursor: pointer; }

.advertiserHeadline { font-family: arial, sans-serif; font-size: 16px; color: white; margin-bottom: 5px; cursor: pointer; }

@media (max-aspect-ratio: 1 / 1) {
  .videoAdUiCtaLayer .ctaAdvertiserInfo { display: block; margin-top: 30px; position: absolute; left: 50%; transform: translateX(-50%); }
}

.unifyRefresh .videoAdUiCtaLayer { padding: 24px 8px 0px; z-index: 1000; pointer-events: auto; }

@media (max-width: 480px) {
  .advertiserChannelThumbnailContainer { margin-bottom: 6px; }
  .advertiserChannelThumbnail { height: 35px; width: 35px; }
  .advertiserHeadline { font-size: 12px; }
  .advertiserDescription { font-size: 8px; }
